"223447":{"id":"223447","name":"Jentry Chau contra O Submundo","slug":"jentry-chau-contra-o-submundo","original_title":"Jentry Chau vs the Underworld","overview":"Prestes a fazer 16 anos, uma garota nada comum redescobre os poderes que tanto tentou evitar e é obrigada a encarar seus demônios... literalmente.","first_air_date":"2024-12-05","episode_run_time":0,"vote_average":8.2,"number_of_seasons":1,"number_of_episodes":13,"created_by":["Echo Wu"],"production_companies":["Titmouse","Buji Productions","Trespassers Will Inc.","Lightbulb Farm"],"genres":["Animação","Action & Adventure","Sci-Fi & Fantasy","Comédia"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/dF5O0dEvxf95FgNMGqYnieExyrw.jpg","poster_path":"https://image.tmdb.org/t/p/original/wy9hIE0L4a0Oymn0OkfJ56omV1w.jpg","cast":["Ali Wong","Lori Tan Chinn","Bowen Yang"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/eufsFEwwyT0GLbsYrbYXUpsVZMf.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eufsFEwwyT0GLbsYrbYXUpsVZMf.jpg","air_date":"2024-12-04","episode_count":13,"overview":"N/A","vote_average":8.9,"episodes":{"1":{"name":"Pior aniversário da vida","overview":"Na Coreia para comemorar seu aniversário, Jentry descobre que ainda tem o poder de soltar fogo pelas mãos e que um demônio implacável quer sua alma.","air_date":"2024-12-05","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/3yZxunlC8hKk7oLDjUtcgJzMUaR.jpg","vote_average":8.5},"2":{"name":"Quinze minutos de chama","overview":"Um portal para o submundo no Texas abre caminho para convidados indesejados. Um segredo deixa o primeiro dia de Jentry no colégio ainda mais difícil.","air_date":"2024-12-05","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/6TRakab3YjPVn6yxf89Hk6Wmw88.jpg","vote_average":9.5},"3":{"name":"Moça com uma pérola","overview":"Jentry tem visões assustadoras que parecem revelar o passado, mas de onde elas vêm? Gugu treina para dominar uma nova habilidade.","air_date":"2024-12-05","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/uX009t2zKBVQ4H0dUMGpzc20j6N.jpg","vote_average":7.5},"4":{"name":"Esqueça o Álamo","overview":"Ed acompanha a turma numa excursão ao Álamo, mas a apresentação do guia sai do controle e uma batalha histórica vai longe demais.","air_date":"2024-12-05","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/es0IG3njWSXfIyOy80H0IQ77rxl.jpg","vote_average":7},"5":{"name":"Algum gui meu príncipe virá","overview":"A conexão com Jentry faz Michael e Kit questionarem as próprias identidades e o que realmente desejam. Uma nova presença ronda os corredores da escola.","air_date":"2024-12-05","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/r61umfv1ZdelxlLY8objHz8TD3d.jpg","vote_average":8},"6":{"name":"Vale tudo no amor e na guerra","overview":"Petiscos fritos, um mercado secreto de magia taoísta e um demônio gigante. Um dia na feira estadual vira um problemão daqueles no Texas.","air_date":"2024-12-05","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/6SJMqsjyD7ftUboYH7JvbwhRIGu.jpg","vote_average":9},"7":{"name":"No Zhong","overview":"Enquanto Ed vigia o portal para o submundo, Gugu leva Jentry a um perigoso reino intermediário, onde estão as respostas sobre seu passado.","air_date":"2024-12-05","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/xMskphePIWp5bAD1dohvGpkEYy6.jpg","vote_average":10},"8":{"name":"Quinze dedos de desconto","overview":"Jentry tem um plano para se livrar dos poderes e finalmente ter sua vida de volta. Mas, para isso, ela precisa da ajuda de Kit.","air_date":"2024-12-05","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/qxiqWYvpI88sTNrxFOz0dUkgsx7.jpg","vote_average":10},"9":{"name":"Todo mundo ganha","overview":"Jentry está começando a se sentir normal, mas Michael acha que ele não está. A Spirit Week desperta sentimentos intensos e termina com um estrondo no campo.","air_date":"2024-12-05","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/rID9NNgmNWEYLxOjSanoXo5UMjv.jpg","vote_average":10},"10":{"name":"Uma noite com as estrelas","overview":"O caos invade o colégio em um confronto épico entre mundos, trazendo demônios para o jogo de futebol americano e colocando a cidade inteira em perigo.","air_date":"2024-12-05","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/a0qwQNfSFh1VTEQycfgqRwh4lTi.jpg","vote_average":10},"11":{"name":"Boas intenções","overview":"Um mês após o ataque do demônio, Jentry e Ed fogem para Diyu planejando resolver problemas familiares. Mas as coisas não são o que parecem.","air_date":"2024-12-05","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/jF13iUpFmn4lB3rogp45pWFkhA6.jpg","vote_average":9},"12":{"name":"Fases da Moonie","overview":"Armada com as lembranças da mãe, Jentry tenta compensar o tempo perdido. Enquanto isso, os alunos se preparam para passar a noite na escola.","air_date":"2024-12-05","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/zdOdF9LDQoT2O3mRt7gGgO99ixm.jpg","vote_average":10},"13":{"name":"Noite na escola","overview":"A tensão chega ao limite no colégio quando demônios invadem a festa, obrigando Jentry e seus amigos a lutar por suas vidas.","air_date":"2024-12-05","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/iMSec9snwMn9RG8tbIIfRPh0RnJ.jpg","vote_average":7}}}}},
